import {
  Flex,
  Box,
  Heading,
  FormControl,
  FormLabel,
  Input,
  Button
} from "@chakra-ui/react";

export function Form() {
  return (
    <Flex width='full' align='center' justifyContent='center'>
      <Box p={2}>
        <Box>
          <Heading>Dio bank</Heading>
        </Box>
        <Box>
          <FormControl></FormControl>
        </Box>
      </Box>
    </Flex>
  )
}
